import React from 'react'
import './Salaries.css'

function addCommas(nStr){
	nStr += '';
	let x = nStr.split('.');
	let x1 = x[0];
	let x2 = x.length > 1 ? '.' + x[1] : '';
	var rgx = /(\\d+)(\\d{3})/;
	while (rgx.test(x1)) {
		x1 = x1.replace(rgx, '$1' + ',' + '$2');
	}
	return x1 + x2;
}

function Salaries(props){
  return(
    <li className="listItem">
      <h2 id="name">{props.jobName}</h2>
      <p>${addCommas(Math.round(props.jobSalary25))} to ${addCommas(Math.round(props.jobSalary75))}</p>
    </li>
  )
}

export default Salaries;
